@AccessControl.authorizationCheck: #NOT_REQUIRED
@EndUserText.label: 'Doc that will be reflected in the ledger'
define root view entity ZETR_DDL_I_LEDGER_REFL_DOC
  as select from    zetr_t_bldbk                                                   as Main
    left outer join DDCDS_CUSTOMER_DOMAIN_VALUE_T( p_domain_name: 'ZETR_D_BSTAT' ) as DocumentStatus on  DocumentStatus.language  = $session.system_language
                                                                                                     and DocumentStatus.value_low = Main.bstat

{
  key Main.bukrs          as CompanyCode,
  key Main.bstat          as DocStatu,
      DocumentStatus.text as DocStatuText

}
